import React, { useState, useEffect } from "react";
import classes from './Navbar.module.css'
import { Link } from "react-router-dom";

function Navbar1() {
  const [isLoged, setIsLoged] = useState(false)
  useEffect(() => {
    const name = localStorage.getItem('name');
    if (name) setIsLoged(true)
  }, [])
  return (
    <>
      <Navbar bg="light" expand="lg">
        <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mr-auto">
            <Nav.Link href="/">Home</Nav.Link>
            <Nav.Link to='/login' href="/products">Gallery</Nav.Link>
            <Nav.Link href="/new-recipe">new recipe</Nav.Link>
            <NavDropdown title="Login" id="basic-nav-dropdown">
              <NavDropdown.Item href="/sign-up">Sign-up</NavDropdown.Item>
              <NavDropdown.Item href="login">Login</NavDropdown.Item>
              <NavDropdown.Item onClick={setIs}>log out</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
            </NavDropdown>
            {isLoged&&<Nav.Link href="/profile">profile</Nav.Link>}
          </Nav>
        
          <Form inline>
            <FormControl type="text" placeholder="Search" className="mr-sm-2 form-inner" />
            <Button variant="outline-success">Search</Button>
          </Form>
        </Navbar.Collapse>
      </Navbar>
      
    </>
  );
}

export default Navbar1;
